(function() {
  app.component('VoteMarker', function(element) {
    return app.voting.styleVoteButton(element);
  });

  app.component('VoteButtonContainer', {
    events: {
      'click [data-vote-id]': 'toggleVote'
    },
    toggleVote: function(e) {
      var buttons, hasVoted, id, target, type, votes;
      e.preventDefault();
      e.stopPropagation();
      if (!this.app.ensureSignIn()) {
        return;
      }
      target = $(e.target).closest('[data-vote-id]');
      id = target.data('vote-id');
      type = target.data('vote-type');
      votes = parseInt(this.findCounter(target).html(), 10) || 0;
      hasVoted = this.app.voting.toggle(type, id);
      votes += hasVoted ? 1 : -1;
      buttons = this.$("[data-vote-type='" + type + "'][data-vote-id='" + id + "']");
      return buttons.eachElement((function(_this) {
        return function(element) {
          _this.app.voting.styleVoteButton(element, hasVoted);
          return _this.findCounter(element).html(votes);
        };
      })(this));
    },
    findCounter: function(element) {
      var nested;
      nested = element.find('[data-vote-count]');
      if (nested.length > 0) {
        return nested;
      } else {
        return element;
      }
    }
  });

  app.voting = {
    hasVoted: function(type, id) {
      return gon.current_user["" + type + "_votes"].indexOf(id) !== -1;
    },
    toggle: function(type, id) {
      var index, vote, votes;
      votes = gon.current_user["" + type + "_votes"];
      index = votes.indexOf(id);
      vote = index === -1;
      $.ajax({
        url: "/" + type + "s/" + id + "/vote",
        type: vote ? 'post' : 'delete'
      });
      this.track(vote, type, id);
      if (vote) {
        votes.push(id);
      } else {
        votes.splice(index, 1);
      }
      return vote;
    },
    track: function(vote, type, id) {
      var data;
      data = {};
      data.type = type;
      data.vote_type = vote ? 'upvote' : 'unvote';
      data["" + type + "_id"] = id;
      return analytics.track('vote', data);
    },
    styleVoteButton: function(element, hasVoted) {
      if (typeof hasVoted === 'undefined') {
        hasVoted = this.hasVoted(element.data('vote-type'), element.data('vote-id'));
      }
      return element.toggleClass('m-upvoted', hasVoted);
    }
  };

}).call(this);
